nPreviously these were swallowed (unlike the ones in black\u002f__init__.py)","Shantanu \u003cbr\u003eBetter error message for invalid exclude types (#3764)\n\n","rdrll \u003cbr\u003eFix a magical comment caused internal error (#3740)\n\n`is_type_comment` now specifically deals with general type comments for a leaf.\r\n`is_type_ignore_comment` now handles type comments contains ignore annotation for a leaf\r\n`is_type_ignore_comment_string` used to determine if a string is an ignore type comment","dependabot[bot] \u003cbr\u003eBump sphinx from 5.3.0 to 6.1.3 in \u002fdocs (#3499)\n\nSigned-off-by: dependabot[bot] \u003csupport@github.com\u003e\r\nCo-authored-by: dependabot[bot] \u003c49699333+dependabot[bot]@users.noreply.github.com\u003e","Shivansh-007 \u003cbr\u003eFormat hex code in unicode escape sequences in string literals (#2916)\n\nCo-authored-by: Jelle Zijlstra \u003cjelle.zijlstra@gmail.com\u003e","Matthew Armand \u003cbr\u003eAdd latest_prerelease Docker Hub tag for following the latest alpha release (#3465)\n\nCo-authored-by: Jelle Zijlstra \u003cjelle.zijlstra@gmail.com\u003e","Richard Si \u003cbr\u003eLazily import parallelized format modules\n\n`black.reformat_many` depends on a lot of slow-to-import modules. When\nformatting simply a single file, the time paid to import those modules\nis totally wasted. So I moved `black.reformat_many` and its helpers\nto `black.concurrency` which is now *only* imported if there's more\nthan one file to reformat. This way, running Black over a single file\nis snappier\n\nHere are the numbers before and after this patch running `python -m\nblack --version`:\n\n- interpreted: 411 ms +- 9 ms -\u003e 342 ms +- 7 ms: 1.20x faster\n- compiled: 365 ms +- 15 ms -\u003e 304 ms +- 7 ms: 1.20x faster\n\nCo-authored-by: Fabio Zadrozny \u003cfabiofz@gmail.com\u003e\n","Cooper Lees \u003cbr\u003eAdd passing 3.11 CI by exempting blackd tests (#3234)\n\n- Had to exempt blackd tests for now due to aiohttp\r\n  - Skip by using `sys.version_info` tuple\r\n  - aiohttp does not compile in 3.11 yet - refer to #3230\r\n- Add a deadsnakes ubuntu workflow to run 3.11-dev to ensure we don't regress\r\n  - Have it also format ourselves\r\n\r\nTest:\r\n- `tox -e 311`\r\n\r\nCo-authored-by: Cooper Ry Lees \u003cme@wcooperlees.com\u003e\r\nCo-authored-by: Richard Si \u003c63936253+ichard26@users.noreply.github.com\u003e","Richard Si \u003cbr\u003eAdd isort to linting toolchain\n\nCo-authored-by: Shivansh-007 \u003cshivansh-007@outlook.com\u003e\n","Richard Si \u003cbr\u003eReformat codebase with isort\n","dependabot[bot] \u003cbr\u003eBump sphinx from 5.0.2 to 5.1.0 in \u002fdocs (#3183)\n\nBumps [sphinx](https:\u002f\u002fgithub.com\u002fsphinx-doc\u002fsphinx) from 5.0.2 to 5.1.0.\r\n- [Release notes](https:\u002f\u002fgithub.com\u002fsphinx-doc\u002fsphinx\u002freleases)\r\n- [Changelog](https:\u002f\u002fgithub.com\u002fsphinx-doc\u002fsphinx\u002fblob\u002f5.x\u002fCHANGES)\r\n- [Commits](https:\u002f\u002fgithub.com\u002fsphinx-doc\u002fsphinx\u002fcompare\u002fv5.0.2...v5.1.0)\r\n\r\n---\r\nupdated-dependencies:\r\n- dependency-name: sphinx\r\n  dependency-type: direct:production\r\n  update-type: version-update:semver-minor\r\n...\r\n\r\nSigned-off-by: dependabot[bot] \u003csupport@github.com\u003e\r\n\r\nCo-authored-by: dependabot[bot] \u003c49699333+dependabot[bot]@users.noreply.github.com\u003e","Felix Hild\u00e9n \u003cbr\u003eMake SRC or code mandatory and mutually exclusive (#2360) (#2804)\n\nCloses #2360: I'd like to make passing SRC or `--code` mandatory and the arguments mutually exclusive. This will change our (partially already broken) promises of CLI behavior, but I'll comment below.\r\n","Jelle Zijlstra \u003cbr\u003efix error message for match (#2649)\n\nFixes #2648.\r\n\r\nCo-authored-by: Batuhan Taskaya \u003cisidentical@gmail.com\u003e","Jelle Zijlstra \u003cbr\u003evim: Parse skip_magic_trailing_comma from pyproject.toml (#2613)\n\nCo-authored-by: Kyle Kovacs \u003ckkovacs@diconfiberoptics.com\u003e","jack1142 \u003cbr\u003eFix flake8 configuration by switching from extend-ignore to ignore (#2320)\n\n","Bryan Bugyi \u003cbr\u003eAccount for += assignment when deciding whether to split string (#2312)\n\nFixes #2294\r\n","Cooper Lees \u003cbr\u003eUpdate CHANGES.md for 21.5b2 release (#2290)\n\n* Update CHANGES.md for 21.5b2 release","Bryan Bugyi \u003cbr\u003eFix --experiemental-string-processing crash when matching parens not found (#2283)\n\nFixes #2271\r\n","Jelle Zijlstra \u003cbr\u003eadd discussion of magic comments to FAQ (#2272)\n\nCo-authored-by: Cooper Lees \u003cme@cooperlees.com\u003e"],"x":["2024-01-02T01:14:57","2023-10-17T11:22:24","2023-10-09T23:15:51","2023-07-05T02:45:57","2023-06-27T11:23:39","2023-03-19T20:00:14","2023-01-22T10:21:09","2022-12-21T00:18:15","2022-08-26T22:11:00","2022-08-23T00:39:48","2022-07-27T18:19:28","2022-07-27T18:19:28","2022-07-26T21:51:32","2022-01-24T12:35:56","2021-11-30T23:39:39","2021-11-16T00:03:47","2021-06-09T11:01:07","2021-06-07T11:01:57","2021-05-31T11:25:54","2021-05-30T16:32:28","2021-05-29T14:16:33"],"xcalendar":"gregorian","y":[402,401,400,401,398,397,393,381,376,375,377,375,377,363,358,355,356,354,353,351,350],"type":"scatter"}],                        {"template":{"data":{"barpolar":[{"marker":{"line":{"color":"#E5ECF6","width":0.5},"pattern":{"fillmode":"overlay","size":10,"solidity":0.2}},"type":"barpolar"}],"bar":[{"error_x":{"color":"#2a3f5f"},"error_y":{"color":"#2a3f5f"},"marker":{"line":{"color":"#E5ECF6","width":0.5},"pattern":{"fillmode":"overlay","size":10,"solidity":0.2}},"type":"bar"}],"carpet":[{"aaxis":{"endlinecolor":"#2a3f5f","gridcolor":"white","linecolor":"white","minorgridcolor":"white","startlinecolor":"#2a3f5f"},"baxis":{"endlinecolor":"#2a3f5f","gridcolor":"white","linecolor":"white","minorgridcolor":"white","startlinecolor":"#2a3f5f"},"type":"carpet"}],"choropleth":[{"colorbar":{"outlinewidth":0,"ticks":""},"type":"choropleth"}],"contourcarpet":[{"colorbar":{"o
